import React, { useState, useEffect } from 'react';

function Providers(){
    const [providers,setProviders] = useState([])
    useEffect(()=>{
        fetch('/providers')
        .then(resp=> resp.json())
        .then(data => setProviders(data))
      },[])

    return (
        <header>
            {providers.map(provider=>{
                return(<p>hello</p>)
            })}
        </header>
    )
}

export default Providers;
